import React from 'react'

export default class Welcome extends React.Component {
  render() {
    currentUser = () => {return this.props.currentUser}
    return(
      <div style={welcomeStyle}>
        <h1>Hello {currentUser.username}!</h1>
        <div>
          <p>Your Stats</p>
          <ul>
            <li>Health: {this.props}</li>
          </ul>
        </div>
      </div>
    )
  }
}

const welcomeStyle = {
  background: "white",
  padding: "1em"
}
